import React from "react";
// import Python from "../images/python.jpeg";
// import C from "../images/c++.png";

const main = () => {
  return (
    <div className="h-400 bg-green-400 ">
      <div className="flex justify-center">
        <h1 className="text-4xl py-8 font-bold">SKILLS</h1>
      </div>

      <div className="flex flex-col md:flex-row ">
        <div className="bg-black m-10 border-2 rounded-xl p-8 h-80 uppercase font-bold md:w-1/3">
          programming languages
          <div className="flex flex-col p-8  ">
            <div className="flex items-center">
              {/* <img className="w-20 rounded-full" src={Python} alt="py-logo" /> */}
              <span>python</span>
            </div>
            <div className="flex items-center">
              {/* <img className="w-20 rounded-full" src={C} alt="" srcset="" /> */}
              <span>C++</span>
            </div>
          </div>
        </div>
        <div className="bg-black m-10 border-2 rounded-xl p-8 uppercase font-bold h-80 md:w-1/3">
          Front-End
        </div>
        <div className="bg-black m-10 border-2 rounded-xl p-8 uppercase font-bold h-80 md:w-1/3">
          back-end
        </div>
      </div>
    </div>
  );
};

export default main;
